type props = {
    title:string,
    text:string,
    setText:React.Dispatch<React.SetStateAction<string>>
}
export const SignInput = ({
    title,
    text,
    setText
}:props) => {
    const onChangeText = (e:any) => {
        setText(e.target.value)
    }
    return(
        <div style={{
            height:'6vh',
            border:'1px solid yellow',
            alignContent:"center",
            justifyContent:"center"
            }}>
            {title}
            <input
                value={text} 
                onChange={(e)=>{onChangeText(e)}}></input>
        </div>
    )
}
